                <p><small class=""help_caption"">Fig11: Gene clustering at the gene level.</small></p>
            </div>
            <p>Here we see that genes C19orf12, GCH1, SLC6A3, SNCA, SYNJ1, ATP13A2 and TH cluster together in the darkorange2 module from substantia nigra. We also see that the clustering is far away from being due to random chance as the fisher´s p-value is 10e-4, but it also survive both FDR and Bonferroni corrections. Another interestint point here is that all genes play a strong role within the module. The <code>mm</code> column refers to the module membership of the gene and values from above 0.5 are already strong values. If we click now in any of the <code>darkorange</code> labels at the <code>module</code> column, we can see that this module is enriched for REACTOME terms as “Axon guidance” and BP terms like “regulation of neurotransmitter levels”. The cell type enrichment for the module is totally neuronal, including dopaminergic markers. Thus, this module is clearly Parkinson r");
            WriteLiteral(@"elated. And this analysis suggests all these genes are implicated on those processes, within this cell type, in substantia nigra. Interestingly, you won´t see this replicated in the putamen, that might suggest this happens in nigra but not in the other PD related tissue.</p>
